import React from 'react';
import { Home, FileText, Users, Settings } from 'lucide-react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-menu">
        <NavLink to="/dashboard/home" className="sidebar-item" activeClassName="active">
          <Home />
          <span>Home</span>
        </NavLink>
        <NavLink to="/dashboard/test-cases" className="sidebar-item" activeClassName="active">
          <FileText />
          <span>Test Cases</span>
        </NavLink>
        <NavLink to="/dashboard/user-management" className="sidebar-item" activeClassName="active">
          <Users />
          <span>User Management</span>
        </NavLink>
        <NavLink to="/dashboard/settings" className="sidebar-item" activeClassName="active">
          <Settings />
          <span>Settings</span>
        </NavLink>
      </div>
    </div>
  );
};

export default Sidebar;
